// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

// On dfinit notre contrat de cagnotte
contract Crowdfunding is Ownable {
    // On stocke l'adresse du crateur de la cagnotte
    address public creator;
    // On stocke le montant total collect
    uint256 public totalCollected;
    // On stocke le montant cibl pour la cagnotte
    uint256 public targetAmount;
    // Nom de la cagnotte
    string public title;
    // Nom de l'association
    string public associationName;
    // Id de la cagnotte
    uint256 public potId;
    // Id de l'association
    uint256 public assocationId;
    // On stocke l'tat de la cagnotte (en cours ou termine)
    bool public isFinished;
    // On stocke l'adresse du contrat ERC20 utilis pour la cagnotte
    IERC20 public token;
    // On stocke les contributions de chaque participant
    mapping(address => uint256) public contributions;

    // On dfinit le constructeur du contrat
    constructor(
        address _owner,
        string memory _title, 
        string memory _associationName, 
        uint256 _potId, 
        uint256 _associationId,
        IERC20 _token,
        uint256 _targetAmount
    ) public {
        creator = _owner;
        token = _token;
        targetAmount = _targetAmount;
        title = _title;
        associationName = _associationName;
        potId = _potId;
        assocationId = _associationId;
    }

    // Fonction pour participer  la cagnotte
    function contribute(uint256 value) public {
        // On vrifie que la cagnotte est en cours
        require(!isFinished, "Crowdfunding finished");
        // On vrifie que le participant envoie au moins 1 token
        require(value > 0, "Invalid contribution amount");
        // On vrifie que le participant a assez de fonds pour effectuer la transaction
        require(token.balanceOf(msg.sender) >= value, "Insufficient funds");
        // On envoie les fonds au contrat de cagnotte
        token.transfer(address(this), value);
        // On incrmente le montant total collect
        totalCollected += value;
        // On met  jour les contributions du participant
        contributions[msg.sender] += value;
        // On met  jour l'tat de la cagnotte si le montant cibl est atteint
        if (totalCollected >= targetAmount) {
            isFinished = true;
        }
    }

    // Fonction pour rcuprer les fonds de la cagnotte
    function collect() public onlyOwner {
        // On vrifie que la cagnotte est termine
        require(isFinished, "Crowdfunding not finished");
        // On vrifie que le demandeur est bien le crateur de la cagnotte
        require(
            msg.sender == creator,
            "Only the creator can collect the funds"
        );
        // On envoie les fonds au crateur de la cagnotte
        token.transfer(creator, totalCollected);
        // On remet le montant total collect  zro
        totalCollected = 0;
    }

    // Fonction pour vrifier si la cagnotte est termine
    function state() public view onlyOwner returns (bool) {
        // On vrifie si le montant cibl a t atteint
        return totalCollected >= targetAmount;
    }

    // Fonction pour cloturer la cagnotte
    function close() public onlyOwner {
        // On vrifie que le demandeur est bien le crateur de la cagnotte
        require(
            msg.sender == creator,
            "Only the creator can close the crowdfunding"
        );
        // On met  jour l'tat de la cagnotte
        isFinished = true;
    }

    // Fonction pour rembourser les participants
    function refund() public onlyOwner {
        // On vrifie que la cagnotte est termine
        require(isFinished, "Crowdfunding not finished");
        // On vrifie que le demandeur est bien le crateur de la cagnotte
        require(
            msg.sender == creator,
            "Only the creator can refund the participants"
        );
        // On parcourt les contributions de chaque participant
        //for (address participant in contributions) {
        // On envoie les fonds correspondants au participant
        //token.transfer(participant, contributions[participant]);
        //}
        // On remet le montant total collect  zro
        totalCollected = 0;
    }
}
